export function deleteDuplicats(cartX: any) {
  let { cart } = cartX;
  let count = cart.filter((cart) => data.id === cart[cart.length - 1].id);
  let qqq = cart.findIndex((cart) => data1.id === cart[cart.length - 1].id);

  if (count.length >= 2) {
    cart[qqq].amount = cart[qqq].amount + cart[cart.length - 1].amount;
    cart.pop();
  }
  return cart;
}
